    "# Exponential function\n",
    "import numpy as np\n",
    "import matplotlib.pyplot as plt\n",
    "from math import cos\n",
    "\n",
    "domain = np.linspace(-1, 1, 100)\n",
    "def f(x):\n",
    "    f = np.exp(1/x)\n",
    "    return f\n",
    "\n",
    "# chebyshev nodes\n",
    "xnew=[]\n",
    "for i in range(12):\n",
    "    q=cos((((2*i)-1)/24)*np.pi)\n",
    "    xnew.append(q)\n",
    "\n",
    "# another way\n",
    "# x = linspace(-1, 1, n) # points to interpolate at\n",
    "# y= np.exp(1/x)\n",
    "# f = interpolate.BarycentricInterpolator(x, y)\n",
    "\n",
    "x=np.asarray(xnew)\n",
    "\n",
    "# chebyshev polinomials \n",
    "p3=np.polynomial.chebyshev.chebfit(x,f(x),3)\n",
    "f3=np.polynomial.chebyshev.chebval(domain,p3)\n",
    "p5=np.polynomial.chebyshev.chebfit(x,f(x),5)\n",
    "f5=np.polynomial.chebyshev.chebval(domain, p5)\n",
    "p10=np.polynomial.chebyshev.chebfit(x,f(x),10)\n",
    "f10=np.polynomial.chebyshev.chebval(domain, p10) \n",
    "\n",
    "# approximation errors \n",
    "e3=f(domain)-f3\n",
    "e5=f(domain)-f5\n",
    "e10=f(domain)-f10\n",
    "\n",
    "# plotting\n",
    "plt.figure(1)\n",
    "\n",
    "plt.subplot(121)\n",
    "plt.plot(domain,f(domain), label='Exponent')\n",
    "plt.plot(domain,f3, label='Cubic')\n",
    "plt.plot(domain,f5, label='Order 5')\n",
    "plt.plot(domain,f10, label = 'Order 10')\n",
    "plt.legend(loc=2)\n",
    "plt.ylim([-2000,10000])\n",
    "plt.title('Exponential function. Chebyshev nodes and polynomials')\n",
    "\n",
    "plt.subplot(122)\n",
    "plt.plot(domain,e3, label='Cubic')\n",
    "plt.plot(domain,e5, label='Order 5')\n",
    "plt.plot(domain,e10, label= 'Order 10')\n",
    "plt.legend(loc='best')\n",
    "plt.ylim([-2000,10000])\n",
    "plt.title('Approximation errors')\n",
    "plt.subplots_adjust(top=0.9, bottom=0.1, left=0, right=1.5, hspace=0.5, wspace=0.5)\n",
    "\n"
