    "# Runge function\n",
    "import numpy as np\n",
    "import matplotlib.pyplot as plt\n",
    "from math import cos\n",
    "\n",
    "domain = np.linspace(-1, 1, 100)\n",
    "def f(x):\n",
    "    f = 1/(1+25*(x**2))\n",
    "    return f\n",
    "\n",
    "# chebyshev nodes\n",
    "xnew=[]\n",
    "for i in range(12):\n",
    "    q=cos((((2*i)-1)/24)*np.pi)\n",
